import React, { useState } from 'react'
import { useEffect } from 'react'
import axios from "axios"
const Users = () => {
    const [users, setUsers] = useState([])

    useEffect(() => {
      const fetchAllUsers = async ()=>{
        try{
            const res = await axios.get("http://localhost:8802/users");
            setUsers(res.data)
        }catch(err){
            console.log(err)
        }
      }
      fetchAllUsers()
    }, [])
    

  return (
    <h1>Users</h1>>
    <table>
        <tr>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Current Enrollment</th>
            <th>Password</th>
            <th>Membership Status</th>
        </tr>
        {users.map(user=>(
        <tr key = {user.id}>
            <td key = {user.id}>{user.first_name}</td>
            <td key = {user.id}>{user.last_name}</td>
            <td key = {user.id}>{user.current_enrollment}</td>
            <td key = {user.id}> {user.password}</td>
            <td key = {user.id}>{user.membership_status}</td>
        </tr>
        ))}
    </table>
  )
}

export default Users
